  false,\n\t\"url\": null,\n\t\"notes\": \"The Watercress Darter Etheostoma nuchale
  is one of the most imperiled fishes in the southeastern U.S. and is listed as endangered
  on the U.S. endangered species list. The species is restricted to five springs and
  spring runs within the Greater Birmingham Metropolitan Area in Jefferson County,
  AL. Maintaining these five populations is a primary goal as delineated in the recovery
  plan for the species, and monitoring of these populations is essential to achieving
  that goal. Also essential is improving our understanding of the ecology of the species
  so that its needs can be more carefully met.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
